import React, { useState } from 'react';
import { Select, Space } from 'antd';
// import { SearchBar } from 'rsuite/esm/Picker';
const options = [];
for (let i = 10; i < 36; i++) {
  const value = i.toString(36) + i;
  options.push({
    label: `Long Label: ${value}`,
    value,
  });
}
function Searchbar  () {
  const [value, setValue] = useState([]);
  const selectProps = {
    mode: 'multiple',
    style: {
      width: '100%',
    },
    value,
    options,
    onChange: (newValue) => {
      setValue(newValue);
    },
    placeholder: 'Select Item...',
    maxTagCount: 'responsive',
  };
  return (
    <Space
      direction="vertical"
      style={{
        width: '274px',marginLeft:'20px',marginTop:'-20px',hei
      }}
    >
      <Select {...selectProps} />

    </Space>
  );
};
export default Searchbar;
